INSERT INTO `tbl_pages` (`id_page`, `user_id`, `judul_page`, `isi_page`, `meta_keywords`, `meta_descriptions`, `updated_at`) VALUES
(1, 1, 'Pengumuman', '<p>JALUR UNDANGAN</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">JALUR UNDANGAN adalah jalur penerimaan mahasiswa baru&nbsp;<strong>BEBAS TEST TULIS</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><strong>a. Prestasi Akademik</strong></p>\r\n\r\n<p style=\"text-align:justify\">Nilai Raport Kelas XII Semester Ganjil Minimal 7.00 pada mata pelajaran Matematika, IPA/IPS, Bahasa Inggris, dan Bahasa Indonesia.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><strong>b. Prestasi Seni, Olah Raga, Keagamaan, Karya Ilmiah</strong></p>\r\n\r\n<p style=\"text-align:justify\">Dibuktikan dengan surat keterangan atau sertifikat dari sekolah/madrasah, dan atau masuk dalam peringkat 5 besar.</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><strong>c. Waktu Pendaftaran</strong></p>\r\n\r\n<table style=\"background-color:transparent; border-collapse:collapse; border-spacing:0px; color:rgb(85, 85, 85); font-family:helvetica neue,helvetica,arial,sans-serif; font-size:14px; max-width:100%; width:80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<ol>\r\n				<li>Gelombang I</li>\r\n				<li>Pengumuman Kelulusan</li>\r\n				<li>Biaya Pendaftaran</li>\r\n				<li>Gelombang II</li>\r\n				<li>Pengumuman Kelulusan</li>\r\n				<li>Biaya Pendaftaran</li>\r\n			</ol>\r\n			</td>\r\n			<td>\r\n			<ul>\r\n				<li>: 1 November 2016 s.d. 22 Februari 2017</li>\r\n				<li>: 25 Februari 2017</li>\r\n				<li>: Rp. 200.000,-</li>\r\n				<li>: 23 Februari 2017 s.d. 27 April 2017</li>\r\n				<li>: 29 April 2017</li>\r\n				<li>: Rp. 250.000,-</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>JALUR REGULER</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">JALUR REGULER adalah jalur penerimaan mahasiswa baru&nbsp;<strong>MELALUI TEST TULIS&nbsp;</strong>yang dilaksanakan secara&nbsp;<strong>ONE DAY SERVICE</strong></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p><strong>c. Waktu Pendaftaran</strong></p>\r\n\r\n<table style=\"background-color:transparent; border-collapse:collapse; border-spacing:0px; color:rgb(85, 85, 85); font-family:helvetica neue,helvetica,arial,sans-serif; font-size:14px; max-width:100%; width:80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<ol>\r\n				<li>Gelombang I</li>\r\n				<li>Biaya Pendaftaran</li>\r\n				<li>Gelombang II</li>\r\n				<li>Biaya Pendaftaran</li>\r\n				<li>Gelombang III</li>\r\n				<li>Biaya Pendaftaran</li>\r\n			</ol>\r\n			</td>\r\n			<td>\r\n			<ul>\r\n				<li>: 26 April s.d. 28 Juni 2017</li>\r\n				<li>: Rp. 300.000,-</li>\r\n				<li>: 01 Juli 2017 s.d. 31 Juli 2017</li>\r\n				<li>: Rp. 350.000,-</li>\r\n				<li>: 01 Agustus s.d. 31 Agustus 2017</li>\r\n				<li>: Rp. 400.000,-</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>WAKTU PENDAFTARAN</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">Pendaftaran dapat dilakukan pada hari&nbsp;<strong>Sabtu - Kamis Pada Jam : 08.00 -14.00 WIB</strong></p>\r\n\r\n<p><strong>HARI JUM&#39;AT LIBUR</strong></p>\r\n', 'PPDB, MMA, Muallimin, Muallimat', 'Pengumuman PPDB Muallimin dan Muallimat', '2017-03-21 15:52:39'),
(2, 1, 'Syarat Pendaftaran', '<p><strong>Lampiran :</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Foto ukuran 3x4 = 6 / 8 lembar <em>(memakai tutup kepala)</em></li>\r\n	<li>Foto copy <strong>NISN</strong></li>\r\n	<li>Foto copy <strong>KK</strong> <em>(nama pendaftar distabilo / dicentang)</em></li>\r\n	<li>Foto copy <strong>KTP</strong> Orang tua</li>\r\n	<li>Foto copy <strong>KIP</strong> / <strong>PKH</strong> <em>(semua boleh)</em></li>\r\n	<li>Foto copy <strong>IJAZAH</strong> / <strong>SKHUN</strong> / <strong>SKL</strong> / <strong>kartu</strong> <strong>UN</strong></li>\r\n	<li>Foto copy <strong>Sertifikat</strong> / <strong>Piagam</strong> <em>(jika ada prestasi)&nbsp;</em></li>\r\n</ol>\r\n', 'PPDB, Syarat Pendaftaran', 'Syarat Pendaftaran', '2017-03-21 15:25:54'),
